var game;
var gameLoaded = false;
var createOnLoaded = false;

window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        this.textures.addBase64('btn_download', assets.btn_download);
        this.textures.addBase64('bg', assets.weighing);
        this.textures.addBase64('btn_retry', assets.btn_retry);
        this.textures.addBase64('circle', assets.circle);
        this.textures.addBase64('right', assets.right);
        this.textures.addBase64('wrong', assets.wrong);
        this.textures.addBase64('win_bg', assets.win_bg);

        var imageCount = 7;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        this.bg = this.add.image(0,0,'bg').setOrigin(0,0)
        var picture_width = 512;
        var picture_height = 358;
        var spacing = 84;
        var pic1_start = game.config.height / 2 - spacing / 2 - picture_height;
        var pic2_start = game.config.height / 2 + spacing / 2 ;
        // downloadBtn.on('pointerdown', function (pointer) {
        //     landingPage();
        // }, this);
        var diff_pos1 = { x: 350, y: 140 };//衣服
        var diff_pos2 = { x: 62, y: 130 };//水龙头
        var diff_pos3 = { x: 265, y: 315 };//榴莲


        this.guide = this.add.sprite(diff_pos2.x, diff_pos2.y, 'circle').setInteractive({draggable: true});
 
        this.guideScale();

        this.diff1_found = false;
        this.diff2_found = false;
        this.diff3_found = false;

        this.input.on('pointerdown', function (pointer) {
            if (this.count >= 3) {
                return;
            }
            
            if (!this.diff1_found && (this.in_areaCloth(pointer, diff_pos1, pic1_start) || this.in_areaCloth(pointer, diff_pos1, pic2_start))) {
                this.diff1_found = true;
                this.showCorrect(diff_pos1.x, diff_pos1.y);
                this.showCorrect(diff_pos1.x, 444 + diff_pos1.y);
                this.clickDiff();
                console.log(1)
                return;
            }

            if (!this.diff2_found && (this.in_area(pointer, diff_pos2, pic1_start) || this.in_area(pointer, diff_pos2, pic2_start))) {
                this.diff2_found = true;
                this.showCorrect(diff_pos2.x, diff_pos2.y);
                this.showCorrect(diff_pos2.x, 444 + diff_pos2.y);
                this.guide.visible = 0
                this.clickDiff();
                console.log(2)
                return;
            }

            if (!this.diff3_found && (this.in_area(pointer, diff_pos3, pic1_start) || this.in_area(pointer, diff_pos3, pic2_start))) {
                this.diff3_found = true;
                
                this.showCorrect(diff_pos3.x, diff_pos3.y);
                this.showCorrect(diff_pos3.x, 444 + diff_pos3.y);
                this.clickDiff();
                console.log(3)
                return;
            }

            var wrong = this.add.image(pointer.x, pointer.y, 'wrong');
            this.tweens.add({
                targets: [wrong],
                rotation: 0.15,
                duration: 100,
                callbackScope: this,
                onComplete: function(tween) {
                    this.tweens.add({
                        targets: [wrong],
                        rotation: -0.15,
                        duration: 100,
                        callbackScope: this,
                        onComplete: function(tween) {
                            wrong.destroy();
                        }
                    });
                }
            });
        }, this);
        this.count = 0;
        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    in_area(pointer, pos, offsetY) {
        var centerX = pos.x;
        var centerY = pos.y + offsetY;
        var range = 30;
        return (pointer.x < centerX + range)
            && (pointer.x > centerX - range)
            && (pointer.y < centerY + range)
            && (pointer.y > centerY - range);
    }

    in_areaCloth(pointer, pos, offsetY) {
        var centerX = pos.x;
        var centerY = pos.y + offsetY;
        var range = 90;
        return (pointer.x < centerX + range)
            && (pointer.x > centerX - range)
            && (pointer.y < centerY + range)
            && (pointer.y > centerY - range);
    }



    showCorrect(x, y) {
        var right = this.add.image(x, y, 'right');
        right.scaleX = 0.6;
        right.scaleY = 0.6;
        this.tweens.add({
            targets: [ right ],
            scaleX: 1,
            scaleY: 1,
            duration: 250,
            ease: 'Back'
        });
    }

    guideScale() {
        this.tweens.add({
            targets: [this.guide],
            scaleX: 1.2,
            scaleY: 1.2,
            duration: 400,
            callbackScope: this,
            onComplete: function(tween) {
                this.guideScaleBack();
            }
        });
    }

    guideScaleBack() {
        this.tweens.add({
            targets: [this.guide],
            scaleX: 1,
            scaleY: 1,
            duration: 500,
            callbackScope: this,
            onComplete: function(tween) {
                this.guideScale();
            }
        });
    }

    clickDiff() {
        if (this.count >= 3) {
            return;
        }
        this.count++;
        if (this.count == 3) {
            // this.showWin();
            // // this.showWoman();
            this.time.delayedCall(800, this.showWoman, null, this);
            this.time.delayedCall(800, this.showMan, null, this);
            this.time.delayedCall(500, this.showWin, null, this);
        }
    }

    showWin() {
        var winPanel = this.add.sprite(game.config.width/2, game.config.height/2 + 500, "win_bg");
        winPanel.setDepth(10);
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics = this.add.graphics({ fillStyle: { color: 0x000000 } });
        graphics.alpha = 0.85;
        graphics.fillRectShape(rect);
        // show panel
        this.tweens.add({
            targets: [winPanel],
            y: game.config.height/2 - 120,
            duration: 1000,
            ease: 'Back',
            callbackScope: this,
            onComplete: function(tween) {
                //原地弹出
                var downloadBtn = this.add.sprite(game.config.width/2 + 50, game.config.height/2 + 40, 'btn_download').setInteractive();
                downloadBtn.setDepth(11);
                
                this.tweens.add({
                    targets: [downloadBtn],
                    y: game.config.height/2 + 40,
                    duration: 300
                })
                
                downloadBtn.on('pointerdown', function(pointer) {
                    // FbPlayableAd.onCTAClick();
                    // ExitApi.exit()
                    landingPage();
                }, this);
                downloadBtn.on('touchstart', function(pointer) {
                    // // FbPlayableAd.onCTAClick();
                    // ExitApi.exit()
                    landingPage();
                }, this);
                
                //原地弹出
                var retryBtn = this.add.sprite(game.config.width/2 - 87, game.config.height/2 + 40, 'btn_retry').setInteractive();
                retryBtn.setDepth(11);
                retryBtn.on('pointerdown', function(pointer) {
                    this.scene.start("PlayGame")
                }, this);
                retryBtn.on('touchstart', function(pointer) {
                    this.scene.start("PlayGame")
                }, this);

               

                downloadBtn.scaleX = 0.8;
                downloadBtn.scaleY = 0.8;
                retryBtn.scaleX = 0.8;
                retryBtn.scaleY = 0.8;
                this.tweens.add({
                    targets: [ downloadBtn, retryBtn ],
                    scaleX: 1,
                    scaleY: 1,
                    duration: 250,
                    ease: 'Back'
                });
            }
        });
    }
    
    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
}

var assets = {"win_bg": "data:image/png;base64,", "right": "data:image/png;base64,", "weighing": "data:image/png;base64,", "wrong": "data:image/png;base64,", "circle": "data:image/png;base64,", "btn_retry": "data:image/png;base64,", "btn_download": "data:image/png;base64,"}